import React, { Component } from 'react'
import Link from 'next/link';
import '../Header/styles.scss'

export class Header extends Component {
    render() {
        const title = this.props.title
        return (
            <div>
            <p>{title}</p>
            {/* example of same file different section styling */}
            <p className='customClass'>I am styled p element </p>
            {/* example of different file styling */}
            <p className='customClassFromFile'>I am styled p element </p>
            <Link href="/">
                {/* example of inline styling */}
                <a style={{'fontSize': '30px'}}>Index</a>
            </Link>

            <Link href="/about">
                <a>About</a>
            </Link>

            <Link href="/blogs">
                <a>Blogs</a>
            </Link>

            <Link href="/cv">
                <a>CV</a>
            </Link>
            
            <Link href="/portfolios">
                <a>Portfolio</a>
            </Link>
            <style jsx>
                {`
                    a {
                        font-size: 20px
                    };

                    .customClass {
                         color: red
                    }
                `}
            </style>
            </div>
        )
    }
}

export default Header
